import React from 'react';
import './Auth.css';

const Auth = () => {
    return (
        <div className='d-flex justify-content-center align-items-center' style={{height: window.innerHeight - 4}}>
            <div class="card">
                <h1 className='mx-auto mt-3 mb-0'>Авторизация</h1>
                <div class="card-body d-flex flex-column">
                    <input placeholder='Введите ваш email...' className='mt-1' />
                    <input placeholder='Введите ваш пароль...' className='mt-3' />
                    <button type="button" className='btn btn-success mt-3 align-self-end'>
                        Войти
                    </button>
                </div>
            </div>
        </div>
    );
};

export default Auth;
